import React from 'react';


const ProductsTable = (props) => {
  const data = [];
  props.produtos.forEach(product => {
    let newData = {key: Math.random().toString(36).substr(2, 9), produto: null, preco: null};
    product.custom_data.forEach(custom => {
      if (custom.key === 'product_name') newData.produto = custom.value;
      else if (custom.key === 'product_price') newData.preco = custom.value;
    });
    data.push(newData)
  });
  return (
      <div>
        <table style={{borderCollapse: 'collapse', width: '100%', marginTop: '30px', backgroundColor: '#fafafa', textAlign: 'center'}}>
          <tbody>
          <tr style={{borderTop: '1px solid #ddd'}}>
            <th>Produto</th>
            <th>Pre√ßo</th>
          </tr>
          {
            data.map(data => {
              return (
               <tr key={data.key} style={{ borderTop: '1px solid #ddd'}}>
                <td>{data.produto}</td>
                <td>R$ {data.preco.toFixed(2)}</td>
              </tr>
              );
            })
          }
          </tbody>
        </table>
      </div>
  );
};

export default ProductsTable;
